import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
//import { faFacebook } from '@fortawesome/free-solid-svg-icons';
import { faFacebookF, faInstagram, faTwitter, faYoutube, faLinkedinIn } from '@fortawesome/free-brands-svg-icons'

import logo from "../images/logo/logoBrand.png";

import "./style.scss";

export const Logo = (props) => {
    /**  const showCircle = false; */

    return (
        <div className="logo">
            <img src={logo} alt="logo" width="50px" height="auto" title="logo" />
        </div>
    );
};

export const SocialLogos = () => {

    const me = StyleSheet.create( {
        color: "red",
        ":after": {
            position: "absolute",
    top: "0",
    left: "0",
    content: "",
    width: "1000px",
    height: "1000px",
    backgroundColor: "blue",
    fontSize: "30rem",
    zIndex: "300"

        }
    }
    )

    return (
        <div className="icons">
            <a href="be.com" >
                <FontAwesomeIcon icon={faFacebookF} className={(true) ? "theCircles" : "false"} />
            </a>
            <a href="be.com" >
                <FontAwesomeIcon icon={faInstagram} style={me}/>
            </a>
            <a href="be.com" >
                <FontAwesomeIcon icon={faTwitter} />
            </a>
            <a href="be.com" >
                <FontAwesomeIcon icon={faYoutube} />
            </a>
            <a href="be.com" >
                <FontAwesomeIcon icon={faLinkedinIn} />
            </a>



        </div>
    );
}
